### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Recursion and Lists**
- **Concepts**: Recursive functions, list manipulation.
- **Example**: Swapping elements in a list using recursion.
- **Key Points**: Understanding how recursive calls manipulate list indices and elements.

#### 2. **Asymptotic Complexity**
- **Concepts**: Big-O notation, logarithmic functions, polynomial functions.
- **Equations**:
  - \( f_3(n) = \log \log n \)
  - \( f_5(n) = 3n \log n \)
  - \( f_4(n) = 10 \log n \)
  - \( f_2(n) = 3n + (\log n)^2 \)
  - \( f_1(n) = 3n^2 + 2n \)
- **Key Points**: Understanding the order of growth of different functions.

#### 3. **Algorithms and Time Complexity**
- **Concepts**: Iterative vs. recursive algorithms, time complexity analysis.
- **Example**: Calculating \( a^n \) using iterative methods.
- **Key Points**: Time complexity of \( O(\log n) \) for efficient exponentiation.

#### 4. **Sorting Algorithms**
- **Concepts**: Selection Sort, Insertion Sort, Merge Sort, Quick Sort.
- **Key Points**:
  - **Selection Sort**: Number of comparisons is \( \frac{(n-1)n}{2} \).
  - **Insertion Sort**: Number of shifts is minimized when the input list is in ascending order.
  - **Merge Sort**: Worst-case time complexity is \( O(n \log n) \).
  - **Quick Sort**: Worst-case time complexity depends on pivot choice (e.g., \( O(n^2) \) for last element pivot in a sorted list).

#### 5. **Data Structures**
- **Concepts**: Stacks, Queues, Linked Lists, Graphs.
- **Key Points**:
  - **Stacks**: Used for checking palindromes and balanced parentheses.
  - **Queues**: Used in various algorithms and data management.
  - **Linked Lists**: Operations like insertion and deletion at the beginning or end can be \( O(1) \).
  - **Graphs**: Topological sorting, BFS, DFS, and degree sequences.

#### 6. **Graph Theory**
- **Concepts**: Degree sequences, BFS, DFS, topological ordering.
- **Key Points**:
  - **Degree Sequences**: Conditions for a sequence to be graphical and connected.
  - **BFS and DFS**: Traversal algorithms and their applications.
  - **Topological Ordering**: Number of distinct topological orderings in a DAG.

#### 7. **Hashing**
- **Concepts**: Linear probing, hash functions.
- **Key Points**: Resolving collisions using linear probing and understanding hash functions.

